import styled from "styled-components"

export const Container = styled.nav`
    width: 100%;
    height: 3rem;
    background-color: #1C023E;
    display: flex;
    justify-content: center;

    align-content: center;
    vertical-align: center;



    a{
        text-decoration: none;
        font-size: 1rem;
        color: white;
        margin: 0 1rem 0 1rem;

    }

    img {
        width: 2rem;
        height: 2rem;
        border-radius: 50%;
    }
`;
